import "./App.css";
import React, { Component, Fragment } from "react";
import Navbar from "./components/layout/Navbar";
import UserItem from "./components/users/UserItem";

class App extends Component {
  constructor() {
    super();
    this.state = {
      id: 10939256,
      login: "eder13",
      avatar_url: "https://avatars1.githubusercontent.com/u/10939256?v=4",
      html_url: "https://github.com/eder13",
    };
  }

  render() {
    return (
      <Fragment>
        <Navbar title="Github Finder" />
        <UserItem />
      </Fragment>
    );
  }
}

export default App;

